body:
@wchan
yes that is actually true, I thought that you could create the Back Operator from the Forward Operator and thus passing some reference from it. My work in progress code is in my branch feature/cudnn-rnn-lstm
yes you need to be whitelisted to actually run the testing.

As per conversation with Sebastian, going to tentatively accept. We will sync with a few people internally to let them know that this change is coming down the pipeline, and push to www early in the week to maximize internal testing and make sure we're not breaking things.
@jquense can you fix the minor unit test failure?
@spicyj can you take a glance, and flag anything that you think would be a show stopper here?
Note to self: verify that we've cut v15 branch before merging.

@mdo said:
you don't need to upgrade to every version. If your project doesn't have clear benefits to using v3, don't try to upgrade it.
@Yohn said:
I do have one question tho, is 3.0 going to following 2.3? or are there plans to do a 2.4? I can see the minor releases after 2.3 like 2.3.1 and 2.3.2 if needed
Are there any plans for upgrading (I mean only bugfixing, of course) 2.x branch after 3.0 release?

@Hixie There is Another Problem Arose here
app bundle by latest flutter (master as of now) not generating x86 , x86_64 versions
Files produced by master branch

@jrieken Great work. The most astonishing point is that this is so fast and lightweight.
I have a question. Insets disappear when we change tabs. Is this an intended behavior?"
I am looking forward to this feature coming to the stable branch.

To add possible locations where object handling is broken:
Line 707 of ngModel.js (within commitViewValue() function)
From:
var viewValue = this.$viewValue;
To:
var viewValue = angular.copy(this.$viewValue);

@keveman , FYI, had to add
copts = if_cuda(["-DGOOGLE_CUDA=1"]),
to the cc_binary in tensorflow.bzl or else the GPU kernels wouldn't register. is that correct, or should i move the register code into the .cu.cc file?

@sorin-ionescu
I notice that your fork of OMZ doesn't have all of the plugins currently available for OMZ. What would be the best way of including some of my favorites, like extract (ironically enough, something that you wrote), using your fork?
Would it be as simple as copying over the plugin and renaming the file to be loaded to 'init.zsh'?

@bazineta The navbar examples are not working, they are missing the required bootstrap.js file and jquery includes.
I just created a working version here: http://jsfiddle.net/KGzvR/1/embedded/result/
The issue I am experiencing is when the menu is collapsed for mobile devices, click the collapse button so the menu expands, then click the 'Dropdown' link, this dropdown appears like the desktop version (as a popup), instead of collapsing into the menu. Anyone else experiencing this issue?

@raisedadead we've discussed this a bit before: #42596 (comment)
The TL;DR was we considered NGINX, routing inside the app and a separate redirection 'layer' (i.e. serve). The conclusion was that the order of preference was app routing > serve > NGINX, but we tried to get Gatsby to handle the redirects and failed.
Unless you've changed your mind about this, I'm fine with continuing to use serve until either Gatsby changes or we migrate to something else that allows us to handle the redirection in the app. What do you reckon?

@mdo
I have opened a new issue, as you have requested:
#7930
